import React from 'react';
import imageUI from './Images/imageUI.jpeg'

function Project(){
    return(
        <div className="project-page">
            <div className="project-inside">
                <div className="project_1">
                  <h1>Projects</h1>
                  <img src="imageUI.jpeg" alt="imageUI" ></img>


                </div>

            </div>
        </div>
    );
}

export default Project
